import {makeStyles} from '@material-ui/core/styles'

export default makeStyles(()=>({
        form: {
            width: '20%',
            margin: 'auto',
            marginTop: '25px'
        },
        searchBox: {
            padding: '5px 20px'
        },
        btn: {
            padding: '4px 6px'
        }
}));
